import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ProfileListing from './containers/ProfileListing';
import Header from './containers/Header';
import ProfileDetails from './containers/ProfileDetails';
import {useDispatch, useSelector} from "react-redux";
import { getUsersFetch} from './redux/actions/sagaActions'


function App() {
  const dispatch = useDispatch();
  const users = useSelector(state => state.myFirstReducer.usres);
  return (
    <div className="App">
      <div> Users: {users.map((user=> (<div>{user.name}</div>)))}</div>
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact component={ProfileListing}/>
          <Route path="/users/:userID" exact component={ProfileDetails} />
          <Route> 404 Not Found </Route>
        </Switch>
      </Router>
    </div>
  );
}


export default App
